css:
.editor .gutter .harbour-plus-error {
  color: #cc0000;
}
.editor .gutter .git-line-added.harbour-plus-error {
  color: #cc0000;
}
.editor .gutter .git-line-modified.harbour-plus-error {
  color: #cc0000;
}
.editor .gutter .git-line-removed.harbour-plus-error {
  color: #cc0000;
}
.goplus-error {
  background-color: #ff4d4d;
  color: #800000;
}
.goplus-warning {
  background-color: #ffc979;
  color: #e07200;
}
.highlight.uncovered .region {
  background-color: #cc0000;
  opacity: 0.2;
}
.highlight.covered .region {
  background-color: #17ca65;
  opacity: 0.2;
}
